import React from "react";
import Header from "./Header";
import ProductDetails from "./ProductDetails";
import ProductList from "./ProductList";
const App =()=>{

    return(
        <div className="container">
            <Header />
            <ProductDetails />
            <ProductList />
        </div>
    )
}

export default App;
